    false,nt"url": null,nt"notes": "This annual narrative report for Rice Lake
    National Wildlife Refuge (including the Sandstone Unit) and Mille Lacs National
    Wildlife Refuge summarizes activities during the 1993 calendar year. The report
    begins with a summary of the yearu2019s highlights and climatic conditions. Land
    acquisition is also covered. The report includes a planning section which discusses
    the master plan, the management plan, public participation, compliance with environmental
    and cultural resource mandates, research, and investigations. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered. Subjects include wetlands, forests, croplands, grasslands, grazing,
    haying, fire management, pest control, water rights, wilderness areas, Farmers Home
    Administration Easements, and private lands. The wildlife section of the report
    discusses wildlife diversity, endangered species, threatened species, waterfowl,
    marsh birds, waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    and wildlife propagation and stocking. The public uses of the Refuge described in
    this report include outdoor classrooms, interpretive exhibits, hunting, fishing,
    trapping, wildlife observation, camping, and law enforcement. The equipment and
    facilities section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, computer systems, and
    energy conservation. Cooperative programs, other economic uses of the Refuge, and
    items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
